import React,{useState} from "react";

export const Tournament = () =>{
    const [show,setShow] = useState(false);
    if(show){
        return(
            <section>
                <div>
                    <h1 class="title" onClick={()=>setShow(true)}>Турниры</h1>
                </div>
            </section>
        )
    }else{
        return(
            <section>
                <div>
                    <h1  class="title" onClick={()=>setShow(true)}>Турниры</h1>
                    <div>
                            В разработке
                    </div>
                </div>
            </section>
        )

    }
    
}
